module.exports = "<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n  <meta charset=\"UTF-8\">\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n  <meta http-equiv=\"X-UA-Compatible\" content=\"ie=edge\">\n  <title>Document</title>\n</head>\n<body>\n\n  <section class=\"title\">\n    <header class=\"header\">\n        <h1 class=\"hotel_name\">Hotel Holiday <span class=\"stars\">★★★★★</span></h1>\n        <address class=\"hotel_address\">Mumbai, INDIA</address>\n      </header>\n    </section>\n\n<section class=\"gallery\">\n      <div *ngFor=\"let image of albums; let i=index\" class=\"one_photo\">\n        <img [src]=\"image.thumb\" class=\"pic\" (click)=\"open(i)\"/>\n      </div>\n    </section>\n<!----<section class=\"photos\">\n        <ul>\n          <li class=\"one_photo\"><a href=\"assets/images/1_large.jpg\" ><img src=\"assets/images/1_thumb.jpg\" alt=\"description of photo 1\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/3_large.jpg\"><img src=\"assets/images/3_thumb.jpg\" alt=\"description of photo 3\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/4_large.jpg\"><img src=\"assets/images/4_thumb.jpg\" alt=\"description of photo 4\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/5_large.jpg\"><img src=\"assets/images/5_thumb.jpg\" alt=\"description of photo 5\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/6_large.jpg\"><img src=\"assets/images/6_thumb.jpg\" alt=\"description of photo 6\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/7_large.jpg\"><img src=\"assets/images/7_thumb.jpg\" alt=\"description of photo 7\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/8_large.jpg\"><img src=\"assets/images/8_thumb.jpg\" alt=\"description of photo 8\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/9_large.jpg\"><img src=\"assets/images/9_thumb.jpg\" alt=\"description of photo 9\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/10_large.jpg\"><img src=\"assets/images/10_thumb.jpg\" alt=\"description of photo 10\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/11_large.jpg\"><img src=\"assets/images/11_thumb.jpg\" alt=\"description of photo 11\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/12_large.jpg\"><img src=\"assets/images/12_thumb.jpg\" alt=\"description of photo 12\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/13_large.jpg\"><img src=\"assets/images/13_thumb.jpg\" alt=\"description of photo 13\" /></a></li>\n          <li class=\"one_photo\"><a href=\"assets/images/14_large.jpg\"><img src=\"assets/images/14_thumb.jpg\" alt=\"description of photo 14\" /></a></li>\n        </ul>\n      </section>-->\n      \n      <section class=\"description\">\n        <h2>Description</h2>\n        <p>Located in the heart of Mumbai, this 5-star hotel offers elegant guest rooms in a Hausmannian-style building. It features a fitness centre, a concierge and a tour desk with ticket service.</p>\n        <p>Decorated in a unique style, the air-conditioned guest rooms at the Hotel Holiday are equipped with satellite TV, a minibar and free Wi-Fi access. Some rooms feature a seating area. All rooms have a private bathroom, some include marble features.</p>\n        <p>The hotel restaurant, Holiday Cafe, has a traditional Parisian decor and serves traditional Indian cuisine. A buffet breakfast is served every morning. Guests can also enjoy a cocktail and jazz evenings twice a week in the Defender Bar.</p>\n        <p>The 4 facades and terrace of this hotel overlook the famous Shivaji Museum, the Escape and the Prithvi theatre.</p>\n        <p>Hotel Holiday is situated 2 minutes from Andheri Metro Station, providing direct access to the Western Railway and the Western Express Highway. Public parking is available nearby.</p>\n      </section>\n      \n      <section class=\"facilities\">\n        <h2>Facilities</h2>\n        <ng-template #content let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\">Free Wi-Fi</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Enjoy free Wi-Fi throughout your stay at Hotel Holiday.<br>Simply select ‘Hotel Holiday Free Wi-Fi’ from the list of available networks and get connected.<br>Check your emails, post Facebook updates, search and browse the web throughout your stay. It’s all on us. &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn-1\" (click)=\"openVerticallyCentered(content)\">Free Wi-fi</button>\n\n       \n        <ng-template #contents let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\">Swimming Pool</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Splash into our cool outdoor pool, lounge on our Sun Deck, order yourself a refreshing mocktail and de-stress yourself.<br>Open from 07:00 a.m. to 08:00 p.m.<br>Minimum 3.7 ft in depth with average overall size of 260.81 sq m.<br>Our pool maintains cleanliness through it's saltwater chlorination ensuring that our guests have a gala time!</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn-2\" (click)=\"openVerticallyCentered(contents)\">Swimming Pool</button>\n\n        <ng-template #contenta let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\">Gym</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>A perfect gym with every equipment, facilities and best trainers are available in our hotel in order to maintain your health.<br><strong>Highlights</strong><br>\n              \n                 Cross-trainer and treadmills<br>\n                 Stationary bikes and rowing machine<br>\n                 Free weights area<br>\n                 Floor-to-ceiling mirrors<br>\n              \n            </p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contenta)\">Gym</button>\n\n\n        <ng-template #contentb let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\"> 24/7 Reception</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Our reception is open all day long and every day of the week.<br>\n              You can consult our staff for information, tours and recommendations.. &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contentb)\"> 24/7 Reception</button>\n\n\n        <ng-template #contentc let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\"> Concierge</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p> We wants to ensure that each and every guest is able to benefit from world-class concierge services, while planning a visit and during their stay in Hotel Holiday.<br>Ready to assist guests with every aspect of their visit, providing advices for activities, information on what to explore and experience, restaurant reservations and assistance with transportation.<br> Service available to you 24 hours a day &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contentc)\">Concierge</button>\n  \n  \n        <ng-template #contentd let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\"> Restaurant</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Our cuisine represents a real strong point: only the best raw materials, the careful and enthusiastic will to mix the antique traditions of the great italian and mediterranean cuisine, with the new schools, modern and sophisticated, for a refined and original result, never expectable, able to meet all needs of elegant and International customers.&hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contentd)\"> Restaurant</button>\n  \n  \n        <ng-template #contente let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\"> \n              Free Parking</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Parking is free of charge, between the hours of 6pm and 8am. Outside of these hours, there is a 2 hour parking restriction and parking fees apply as per the ticketed costs. &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contente)\"> \n          Free Parking</button>\n  \n  \n        <ng-template #contentf let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\"> Shoe-Shine</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>The Hotel Holiday is a splendid base for our main shoeshine location: Luxurious, comfortable surroundings, the quiet unhurried attention of staff, and perfectly positioned close to Marble Arch.<br>We start with brushing down the shoe and then applying Renovateur cream. This cleans up the shoes and prepares it for the shine. We then add several thin layers of high quality wax with our fingertips, massaging the wax into the leather. Then we buff with a series of cloths and voila: Your shoes are ready to hit the streets again!&hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contentf)\"> Shoe-Shine</button>\n\n\n        <ng-template #contenth let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\">Room service</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>The Hotel Holiday Room Service accepts orders 24 hours a day. It serves hearty Western style meals, and Japanese food, including appetizers, soups, main courses, and desserts. For travelers who have just arrived or others who want something light, smaller meals or snacks such as sandwiches and udon noodles are available.<br><strong>Highlight</strong><br>\n              Breakfast: 6:00 a.m. - 11:30 a.m.<br> Luncheon and Dinner: 11:30 a.m. - 9:30 p.m.<br> Late Evening Selections: 9:30 p.m. - 1:00 a.m.<br> Early Morning Selections: 1:00 a.m. - 6:00 a.m.\n              &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contenth)\">Room service</button>\n  \n  \n  <ng-template #contentg let-modal>\n          <div class=\"modal-header\">\n            <h4 class=\"modal-title\">Satellite TV</h4>\n            <button type=\"button\" class=\"close\" aria-label=\"Close\" (click)=\"modal.dismiss('Cross click')\">\n              <span aria-hidden=\"true\">&times;</span>\n            </button>\n          </div>\n          <div class=\"modal-body\">\n            <p>Tv in every room to enjoy your favourite show.<br>\n              We provide television shows, movies, OnDemand content, and even customized content according to you need.<br>\n              You can also enjoy netflix and amazon prime shows. &hellip;</p>\n          </div>\n          <div class=\"modal-footer\">\n            <button type=\"button\" class=\"btn btn-danger\" (click)=\"modal.close('Close click')\">Close</button>\n          </div>\n        </ng-template>\n        <button class=\"btn\" (click)=\"openVerticallyCentered(contentg)\">Satellite TV</button>\n  \n  \n      \n  \n      \n\n      \n      \n\n\n\n\n    </section>\n  \n</body>\n</html>\n"

